const initialState = [{
    id: 1,
    todo: 'Comprar la RTX 3060 Ti a buen precio.',
    done: false
}];

const todoReducer = (state = initialState, action) => {


    return state;
}

const newTodo = {
    id: 2,
    todo: 'Comprar un R5 5600X',
    done: false
}

const action = {
    type: 'add',
    payload: newTodo
}


let todos = todoReducer();
console.log(todos);
